import React from 'react';

class AdminLogin extends React.Component{
  render(){
    return(
      <>
         <div>
            <div>
              <h1> Admin Login </h1>
              <form>
                  <input type="text" name="usename"/>
                  <input type="text" name="password"/>
                  <input type="submit" value="Submit" />
              </form>
            </div>

         </div>

      </>
    )
  }
}

export default AdminLogin;
